import React from 'react';
import { Paper, TextField } from '@mui/material';

export default function Register() {
  return (
    <Paper style={{ width: '80vw', height: '80vh', padding: '20px', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
      <TextField label="Enter Name" fullWidth style={{ marginBottom: '16px' }} />
      <TextField label="Enter Email" fullWidth style={{ marginBottom: '16px' }} />
      <TextField label="Enter Password" type="password" fullWidth style={{ marginBottom: '16px' }} />
    </Paper>
  );
}
